caption.text:
Membangun kota bukan hanya tentang bangunan, melainkan membangun sebuah citra kota yang lebih baik dan juga membangun masyarakat agar sistem yang direncanakan bisa berjalan dengan baik.

Contohnya dengan hal kecil untuk tidak membuang sampah sembarangan, juga menjaga alun-alun dengan tidak menggunakan alas kaki. Dan lihatlah bagaimana masyarakat bisa tertib dengan sistem tersebut.

Nuhun Kang Emil, semoga masyarakat Kota Bandung bisa semakin baik lagi untuk mencapai #BandungJuara.

Dias Muhammad Akbar
